exports.command=function(excused_from_1 , confined_to_1 , Maximum_lifting_1 , force_pushing_1, long_distances_1, Sitting_excessive_1, Standing_excessive_1, 
	                      noRepetitiveBending_1, useCautionWhileEntering_1, lightRecreation_1, returnto_1,excused_from,
                                      confined_to,Maximum_lifting,force_pushing,long_distances,Sitting_excessive,Standing_excessive,noRepetitiveBending,
                                      useCautionWhileEntering,lightRecreation,returnto){
      this
      .pause(1000)
      .useCss()
      .getLocationInView('#unableToDrivelongDistancesid')
      .pause(1000)
      .getLocationInView('#date_id')
      .pause(1000)

       for(i=1; i<=3; i++){
      var a1=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   excused_from_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="beExcusedRadio"][value="'+i+'"]' , 'checked' , a1)
      }

      for(i=1; i<=2; i++){
      var a2=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   confined_to_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="beConfinedRadio"][value="'+i+'"]' , 'checked' , a2)
      }

      for(i=1; i<=5; i++){
      var a3=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   Maximum_lifting_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="maximumLiftingCapabilitRadio"][value="'+i+'"]' , 'checked' , a3)
      }


       for(i=1; i<=5; i++){
      var a4=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   force_pushing_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="lowForcePushingRadio"][value="'+i+'"]' , 'checked' , a4)
      }

      this
       .getValue('#unableToDrivelongDistancesid' , function(result){
                long_distances_1.push(result.value)
       })

       for(i=1; i<=5; i++){
      var a5=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   Sitting_excessive_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="sittingExcessivePeriodsRadio"][value="'+i+'"]' , 'checked' , a5)
      }

       for(i=1; i<=5; i++){
      var a6=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   Standing_excessive_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="standingExcessivePeriodsRadio"][value="'+i+'"]' , 'checked' , a6)
      }

      this
        .getValue('#noRepetitiveBendingid' , function(result){
        	noRepetitiveBending_1.push(result.value)
        })
        .getValue('#useCautionWhileEnteringid' , function(result){
           useCautionWhileEntering_1.push(result.value)
        })
        .getValue('#lightRecreationid' , function(result){
        	lightRecreation_1.push(result.value)
        })


        for(i=1; i<=3; i++){
      var a6=(function(){
        var j=i
        return function(result){
            if(result.value=="true"){
                   returnto_1.push(j)
          }
        }})()
        this
      .getAttribute('input[name="returnto"][value="'+i+'"]' , 'checked' , a6)
      }

      this
       .pause(300)
       .verify.visible('input[id="acceptstatement_id"][checked="checked"]')
//---------------------------------------------------------------------------------------------------------------------------------------------------------
       
       this
         .verify.elementPresent('input[name="beExcusedRadio"][value="'+excused_from+'"][checked="checked"]')
         .verify.elementPresent('input[name="beConfinedRadio"][value="'+confined_to+'"][checked="checked"]')
         .verify.elementPresent('input[name="maximumLiftingCapabilitRadio"][value="'+Maximum_lifting+'"][checked="checked"]')
         .verify.elementPresent('input[name="lowForcePushingRadio"][value="'+force_pushing+'"][checked="checked"]')
         .verify.valueContains('#unableToDrivelongDistancesid' , long_distances)
         .verify.elementPresent('input[name="sittingExcessivePeriodsRadio"][value="'+Sitting_excessive+'"][checked="checked"]')
         .verify.elementPresent('input[name="standingExcessivePeriodsRadio"][value="'+Standing_excessive+'"][checked="checked"]')
         .verify.valueContains('#noRepetitiveBendingid' , noRepetitiveBending)
         .verify.valueContains('#useCautionWhileEnteringid' , useCautionWhileEntering)
         .verify.valueContains('#lightRecreationid' , lightRecreation)
         .verify.elementPresent('input[name="returnto"][value="'+returnto+'"][checked="checked"]')



        

        // console.log("excused_from-------------->"+[excused_from==excused_from_1])
        // console.log("confined_to--------------->"+[confined_to==confined_to_1])
        //console.log("Maximum_lifting----------->"+[Maximum_lifting==Maximum_lifting_1])
        //console.log("force_pushing------------->"+[force_pushing==force_pushing_1])
        //console.log("long_distances------------>"+[long_distances==long_distances_1])
        //console.log("Sitting_excessive--------->"+[Sitting_excessive==Sitting_excessive_1])
        //console.log("Standing_excessive-------->"+[Standing_excessive==Standing_excessive_1])
        // console.log("noRepetitiveBending------->"+[noRepetitiveBending==noRepetitiveBending_1])
        // console.log("useCautionWhileEntering--->"+[useCautionWhileEntering==useCautionWhileEntering_1])
        // console.log("lightRecreation----------->"+[lightRecreation==lightRecreation_1])
        //console.log("returnto------------------>"+[returnto==returnto_1])       

return this


}